import React, { useState, useEffect } from 'react';
import MovieCard from './MovieCard';
import axios from "axios";


function TopTen(props){
  const [movies, setMovies] = useState([]);  
  const api_key = "670ab1cd0ceaf592ba7be80c8098630f";

  useEffect(() => {
    axios
      .get(`https://api.themoviedb.org/3/movie/popular?api_key=670ab1cd0ceaf592ba7be80c8098630f&language=es-ES`)
      .then((res) => setMovies(res.data.results))
      .catch(console.error);
  }, [movies]);

  let moviesPagination = movies.slice(0, 10);

  return(
    <div id="topTen">
      {moviesPagination.map((movie, index) => (
        <MovieCard
          key={index}
          id={movie.id}
          image={movie.poster_path}
          title={movie.title}
          description={movie.overview}
        />
      ))}
    </div>
  );
}

export default TopTen;
